import "./styles.css";
import React ,{Component} from 'react';
import { BrowserRouter, Routes, Link, Route } from 'react-router-dom';
import Home from './components/home';

function App() {
  return (
      <BrowserRouter>
            <p>뭐 어쩌라고</p>
      <Routes>
        <Route path={"/"} render={()=><Home / >}/>
      </Routes>
      </BrowserRouter>
  );
}

export default App;
